import React from "react";
import classes from "../css/strengthindicator.module.css";
const StrengthBar = () => {
  return (
    <>
      <div className={classes["strength-div"]}></div>
      <div className={classes["strength-div"]}></div>
      <div className={classes["strength-div"]}></div>
      <div className={classes["strength-div"]}></div>
    </>
  );
};

export default StrengthBar;
